import React, { useState, useEffect } from 'react';
import { Container, Typography, Paper, Box, TextField } from '@mui/material';

// Function to convert date to float
const dateToFloat = (dateString) => {
  const date = new Date(dateString);
  const start = new Date(date.getFullYear(), 0, 0);
  const diff = (date - start) + ((start.getTimezoneOffset() - date.getTimezoneOffset()) * 60 * 1000);
  const oneDay = 1000 * 60 * 60 * 24;
  const dayOfYear = Math.floor(diff / oneDay);
  const year = date.getFullYear();
  const daysInYear = (year % 4 === 0 && year % 100 !== 0) || year % 400 === 0 ? 366 : 365;
  const dateAsFloat = year + (dayOfYear / daysInYear);

  return dateAsFloat.toFixed(2);
};

// Function to get the current date as a string in YYYY-MM-DD format
const getCurrentDateString = () => {
  const today = new Date();
  const year = today.getFullYear();
  const month = String(today.getMonth() + 1).padStart(2, '0');
  const day = String(today.getDate()).padStart(2, '0');
  return `${year}-${month}-${day}`;
};

const getBottomPrice = (dateFloat) => {
  return (0.0117 * Math.pow(dateFloat - 2022.35, 2.556)).toFixed(3);
};

const getTopPrice = (dateFloat) => {
  return (0.04959 * Math.pow(dateFloat - 2022.35, 2.157)).toFixed(3);
};

const getFairPrice = (dateFloat) => {
  return (0.03065 * Math.pow(dateFloat - 2022.35, 2.3565)).toFixed(3);
}

function App() {
  const currentDate = getCurrentDateString();
  const dateFloat = dateToFloat(currentDate);

  const [selectedDate, setSelectedDate] = useState(currentDate);
  const [bottomPrice, setBottomPrice] = useState(getBottomPrice(dateFloat));
  const [fairPrice, setFairPrice] = useState(getFairPrice(dateFloat));
  const [topPrice, setTopPrice] = useState(getTopPrice(dateFloat));

  const handleDateChange = (event) => {
    const newDate = event.target.value;
    setSelectedDate(newDate);
    const dateFloat = dateToFloat(newDate);
    setBottomPrice(getBottomPrice(dateFloat));
    setFairPrice(getFairPrice(dateFloat));
    setTopPrice(getTopPrice(dateFloat));
  };

  return (
    <Container
      maxWidth="sm"
      style={{
        backgroundColor: '#333',
        padding: '20px',
        borderRadius: '10px',
        color: '#fff',
        marginTop: '20px',
      }}
    >
      <Typography
        variant="h4"
        component="h1"
        gutterBottom
        align="center"
        style={{ color: '#fff' }}
      >
        Kaspa Power Law
      </Typography>
      <Typography
        variant="h6"
        component="h2"
        gutterBottom
        align="center"
        style={{ color: '#ccc' }}
      >
        According to its Power Law
      </Typography>
      <Box
        display="flex"
        justifyContent="center"
        alignItems="center"
        marginBottom="20px"
      >
        <TextField
          id="date"
          label="Select a Date"
          type="date"
          value={selectedDate}
          onChange={handleDateChange}
          InputLabelProps={{
            shrink: true,
          }}
          sx={{
            '& .MuiInputBase-root': {
              color: '#fff',
            },
            '& .MuiInputLabel-root': {
              color: '#fff',
            },
            '& .MuiOutlinedInput-root': {
              '& fieldset': {
                borderColor: '#555',
              },
              '&:hover fieldset': {
                borderColor: '#777',
              },
              '&.Mui-focused fieldset': {
                borderColor: '#999',
              },
            },
          }}
        />
      </Box>
      <Paper
        elevation={3}
        style={{
          padding: '20px',
          backgroundColor: '#444',
          textAlign: 'center',
        }}
      >
        <Typography
          variant="h6"
          component="p"
          style={{ color: 'green', margin: '10px 0' }}
        >
          Top Price: { topPrice }
        </Typography>
        <Typography
          variant="h6"
          component="p"
          style={{ color: 'red', margin: '10px 0' }}
        >
          Bottom Price: { bottomPrice}
        </Typography>
        <Typography
          variant="h6"
          component="p"
          style={{ color: 'blue', margin: '10px 0' }}
        >
          Current Price: $57,754 (19% undervalued)
        </Typography>
      </Paper>
      <Typography
        variant="h6"
        component="h2"
        gutterBottom
        align="center"
        style={{ marginTop: '20px', color: '#ccc' }}
      >
        FAQ
      </Typography>
      <Paper
        elevation={3}
        style={{
          padding: '20px',
          backgroundColor: '#444',
        }}
      >
        <Typography variant="body1" component="p" style={{ color: '#fff' }}>
          <strong>1) What is Kaspa?</strong>
        </Typography>
        <Typography variant="body2" component="p" style={{ color: '#ccc' }}>
          Bitcoin's relationship with a power law was discovered by Giovanni Santostasi when he realized that bitcoin's price moved in a straight line when it was plotted in a log-log graph.
        </Typography>
        <Typography variant="body1" component="p" style={{ color: '#fff' }}>
          <strong>2) What is Kaspa's Power Law Model?</strong>
        </Typography>
        <Typography variant="body2" component="p" style={{ color: '#ccc' }}>
          Bitcoin's relationship with a power law was discovered by Giovanni Santostasi when he realized that bitcoin's price moved in a straight line when it was plotted in a log-log graph.
        </Typography>
        <Typography
          variant="body2"
          component="p"
          style={{ marginTop: '10px', color: '#ccc' }}
        >
          This is the only asset that behaves this way, indicating there is something intrinsic about the nature of Bitcoin which allows us to predict its price into the future.
        </Typography>
      </Paper>
    </Container>
  );
}

export default App;
